import React, { Component } from "react";
import './Project.css';

class Project extends Component {
	render() {

    return (
      <div className="Project">

           <h1>{this.props.name}</h1>
           <img src="https://i.pinimg.com/originals/b5/5f/b9/b55fb9cd950695cc2c2b7f31975379bd.jpg"/>

	       <p>{this.props.body}</p>
	  </div>
    );
  }
}

export default Project;
